import React from 'react';
import ContractForm from "../ContractForm";
import { drizzleConnect } from "drizzle-react";

class NewResident extends React.Component {
	render() {
		return(
			<ContractForm contract="MadridCentral" method="addResident" name="Añadir Residente"/>
		);
		return (
			<div>
				<form>
	  				<label>
	    				Nombre:
	    				<input type="text" name="name" /><br></br>
	    				Email:
	    				<input type="text" name="email" /><br></br>
	    				Código de Madrid Central:
	    				<input type="text" name="code" /><br></br>
	    				Teléfono:
	    				<input type="text" name="phone" /><br></br>
	    				Precio de las invitaciones:
	    				<select name="price">
	   						<option value="1">1000</option> 
						   	<option value="2">2000</option> 
						   	<option value="3">3000</option>
						   	<option value="4">4000</option> 
						   	<option value="5">5000</option> 
						</select><br></br>
	    				Número de invitaciones:
	    				<select name="n_invitations">
	   						<option value="1">1</option> 
						   	<option value="2">2</option> 
						   	<option value="3">3</option>
						   	<option value="4">4</option> 
						   	<option value="5">5</option>
						   	<option value="6">6</option> 
						   	<option value="7">7</option> 
						   	<option value="8">8</option>
						   	<option value="9">9</option> 
						   	<option value="10">10</option> 
						   	<option value="11">11</option> 
						   	<option value="12">12</option> 
						   	<option value="13">13</option>
						   	<option value="14">14</option> 
						   	<option value="15">15</option> 
						   	<option value="16">16</option> 
						   	<option value="17">17</option> 
						   	<option value="18">18</option>
						   	<option value="19">19</option> 
						   	<option value="20">20</option>  
						</select><br></br>
	  				</label>
	  					<input type="submit" value="Registrarse" />
				</form>		
			</div>
		);
	}

}

const mapStateToProps = state => {
  return {
    MadridCentral: state.contracts.MadridCentral,
    accounts: state.accounts
  };
};

export default drizzleConnect(NewResident, mapStateToProps);
